import React, { useState } from 'react';
import { Topbar } from '../Components/Topbar/topbar';
import { useNavigate } from 'react-router-dom';

import './pages.css'

export const ModePage = (props) => {

    const navigate = useNavigate();

    const modeButtonClick = async () => {
        try {
        //   POST 요청 보내기
        //   await axios.post('https://example.com/api/data', { /* 요청 데이터 */ });
        //   요청이 성공하면 다른 페이지로 이동
          navigate('/start');
        } catch (error) {
            //
        }
    };

    return(
        <>
            <Topbar removeToken={props.removeToken}/>
            <div className='modepage'>
                <div>
                    진행자의 안내에 맞는 모드를 선택해주세요.
                </div>
                <div className='modeBox'>
                    <div className='modeBtn' onClick={modeButtonClick}>
                        Mode A
                    </div>
                    <div className='modeBtn' onClick={modeButtonClick}>
                        Mode B
                    </div>
                </div>
            </div>
        </>
    )
}
